import React from 'react';
import ReactDOM, { createRoot } from "react-dom/client"
import "./style.css"
import one from "./assets/images/one.jpg"
import two from "./assets/images/three.jpg"
import three from "./assets/images/two.jpg"


const root = ReactDOM.createRoot(document.getElementById("root"))


//Nav Component
function Navbar(){
    return(
        <nav>
            <h1>Perfumy</h1>
            <ul>
            <li>Home | </li>
            <li>Products | </li>
            <li>About | </li>
            <li>Contact | </li>
            </ul>
        </nav>
    )
}

//search 
function Search(){
    return(
        <div className='searchbar'>
            <input type='text' placeholder='Search perfumes..'/>
        </div>
    )
}

//product
function Product(){
    return(
        <div class="products">

            <div class="box">

                        <img src={one}></img>
                        <p>Fogg Wood Extreme, Eau De Parfum, Long-lasting Perfume, 100ml</p>    
            </div>

            <div class="box">
                <img src={two}></img>
                <p>Fogg Wood Extreme, Eau De Parfum, Long-lasting Perfume, 100ml</p> 
            </div>
            <div class="box">
                <img src={three}></img>
                <p>Designer Club-Be Spoke by Perfume Lounge Men's Perfume | Premium Long Lasting Perfume</p>
            </div>            
        </div>
    )
}

//About
function About(){
    return(
        <footer>

            <div class="contact">
                <h3>Contact</h3>
                <p style="margin-top: 5px;">+91 3478631928 <br></br>
                    perfumy@gmail.com
                </p>

            </div>

           <p style="font-size: small; padding: 20px;color: grey;">
            W3Schools is optimized for learning and training. Examples might be simplified to improve reading and learning. Tutorials, references, and examples are constantly reviewed to avoid errors, but we cannot warrant full correctness of all content. While using W3Schools, you agree to have read and accepted our terms of use, cookie and privacy policy.

            Copyright 1999-2023 by Refsnes Data. All Rights Reserved.
            W3Schools is Powered by W3.CSS.
           </p>
        </footer>
    )
}


root.render(
    <div>
    <Navbar></Navbar>
    <Search></Search>
    <Product></Product>
    <About></About>
    </div>
)
